    <List
      className="demo-loadmore-list"
      itemLayout="horizontal"
      dataSource={list}
      renderItem={(item) => (
        <List.Item
          actions={[<a key="list-loadmore-edit">编辑</a>, <a key="list-loadmore-more">more</a>]}
        >
          <Skeleton  
          title={false} 
          loading={item.loading} 
          active>
